\f0\b\fs24 \cf2 Demo Transmitter:
\f1\b0 \cf3  A variety of content and data sources can be chosen for transmit through a GNU Radio flow graph. GNU Radio, an open source digital signal processing framework, is running on a host PC. The host PC is connected to a BladeRF Micro 2.0 software-defined radio, which is controlled by GNU Radio. \
\
For deployment, the BladeRF will need amplification in order to operate the DB6NT transverter at full 200mW power. An additional power amplifier after the transverter may be needed in order to achieve an appreciable footprint for the beacon. For laboratory demonstrations, the BladeRF SDR is connected directly to the DB6NT transverter and there is no power amplifier after the transverter. This produces enough signal to close a 16APSK 9/10 code rate link across a room. }

